export const Navigator = () => {
  const scheme = useColorScheme();
  console.log(scheme);
  return (
    <AppearanceProvider>
      <NavigationContainer theme={DarkTheme}>
        <Tab.Navigator
          initialRouteName="Feed"
          tabBarOptions={{
            activeTintColor: "#42f44b",
          }}
        >
          <Tab.Screen
            name="HomeStack"
            component={Home}
            options={{
              tabBarLabel: "Home",
              /*        tabBarIcon: ({ color, size }) => (
              <MaterialCommunityIcons name="home" color={color} size={size} />
            ), */
            }}
          />
          <Tab.Screen
            name="SettingsStack"
            component={Profile}
            options={{
              tabBarLabel: "Settings",
            }}
          />
        </Tab.Navigator>
      </NavigationContainer>
    </AppearanceProvider>
  );
};
